import React from 'react'
import './Home.scss';
import HeroSection from '../HeroSection';
import Cards from '../Cards';
function Home() {
    return (
        <>
            <HeroSection></HeroSection>
            <Cards/>
            <div className= "welcome">
                <h1>Welcome to NSS NSUT.</h1>
            </div>
        </>
    )
}

export default Home;
